import '../styles/App.css';
import Registration from '../pages/registration';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
      <Switch>
        <Route path="/about">
            <Registration />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
